window.bookSummaryJSON = "When Enola learns of a missing left-handed artist, she uses a series of clever disguises to brave lurking dangers and follow cryptic clues that lead to the young Lady Cecily. <p>Two-time recipient of the Edgar Award for Best Young Adult Mystery, <i>New York Times</i> best-selling author Nancy Springer is known for her beloved Tales of Rowan Hood, her award-winning Arthurian novels, and her critically acclaimed <i>The Case of the Missing Marquess</i> - the first of her compelling mysteries starring the precocious sister of Sherlock Holmes.</p>"; 
